import logo from './logo.svg';
import './App.css';
import Header from './components/layout/header/Header';
import Footer from './components/layout/footer/Footer';

function App(props) {
  return (
    <div>
      <Header />
      <div>
        {props.children}
      </div>
      <Footer />
    </div>
  );
}

export default App;
